const Alert = (props) => {
    return(
        <div className="default" style={props.style}>
            {props.message ? (
                <p>{props.message}</p>
            ) : (
                <h5 className='default-msg black'>Click a pic to start!</h5>
            )}
        </div>
    )
}
export default Alert
